function Navigation() {
  return (
    <nav style={{
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      padding: '20px 40px',
      maxWidth: '1400px',
      margin: '0 auto',
    }}>
      <div style={{ 
        fontSize: '24px', 
        fontWeight: 'bold',
        display: 'flex',
        alignItems: 'center',
        gap: '8px',
      }}>
        <span style={{
          color: '#61DAFB',
          fontSize: '28px',
        }}>K</span>
        Portfolio
      </div>
      <div style={{
        display: 'flex',
        gap: '40px',
      }}>
        <a href="#home" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Home</a>
        <a href="#features" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Features</a>
        <a href="#product" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Product</a>
        <a href="#clients" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Clients</a>
      </div>
    </nav>
  );
}

export default Navigation;
